B.a_Y=new A.bO("The shortcuts were designed by me specifically for this skin. As I could not find an existing icon pack matching the design or including all the necessary icons, I decided to create my own. They are based on the fluent design system of Windows 10 and have a gradient-style approach, creating depth and adding to the skins character.\n\nIn the past, there have been attempts to please them as a separate icon pack but the work demand was very high and the each icon\u2019s adaptability to the new design was not guaranteed. The project as available for some time but was eventually taken down.",null,null,null,null,null,null,null,null)
B.a_Z=new A.bO("The basic color palette of ClockWorld comes from the selected wallpapers, each one representing the color of the sunlight at that time of the day. As a highly customizable skin, the colors shouldn\u2019t be tied to one or two specifics but work as  base for user changes. Via the settings menu, the user can select any color or each of the 5 timestamps of the day and create their own version of he skin.",null,null,null,null,null,null,null,null)
B.a00=new A.bO("The skin\u2019s design is based on ClockWorld. As a designer, I want to keep a specific style that characterizes my work and makes it recognizable among other creators. Thus, I chose to keep the most prominent design choices present in ClockWorld and give them  slight twist, making something different from the same successful base. Overall, Sparse\u2019s design is very straightforward with two widgets, one on top the top and another on the bottom of the screen, coming down to information hierarchy and visual balance. The time, date and weather widgets are grouped together transforming that part of he desktop to a status center that displays basic information about everyday things. On the other hand, the music player on the bottom of the screen works as a simple indicator of the current playing song, while giving an artistic style to the desktop. All in all, the skin\u2019s design is focused on keeping things as hassle-free as possible by including the basic information anyone would need during their time using their devices. ",null,null,null,null,null,null,null,null)
B.a01=new A.bO('The design is based on the widely used motion graphics design for "Upcoming" content on TV channels around the world. I tried to use this approach to the conventional channel program video by adding some more eye-catching visual effects and improving its importance on the screen. What is more, the smooth transitions as well as the position of the graphics catch the attention of the watcher and ensure a readable and familiar experience.',null,B.e9,null,null,null,null,null,null)
B.a02=new A.bO("The settings menu is the best example of a good user experience in every application. In clockworld, it enables the customization of the skin in various ways, split into categories. it manages to display a big amount of information organized in a very convenient way. Just like that, clockworld settings menu features consistency along with sleek and user friendly environment despite rainmeter\u2019s restrictions. By using packages created by the community and with the advice of its people, this interface came to life and it\u2019s praised as one of he best Rainmeter settings menus out there.",null,null,null,null,null,null,null,null)
B.a04=new A.bO("views",null,null,null,null,null,null,null,null)
B.a05=new A.bO("badges",null,null,null,null,null,null,null,null)
B.a07=new A.bO("ClockWorld was voted as the 8th best Rainmeter skin of 2022. Its minimalistic but fully customizable design provides usability that basic windows devices lack. Features like app shortcuts and music controls enhance the user\u2019s experience while beautiful alternating wallpapers create a new scenery 5 times a day. ",null,null,null,null,null,null,null,null)
