B.a09=new A.bO("The font selection was one of the most crucial decision for he skin\u2019s appearance. The type of each font can shape the skin\u2019s character and it is the first asset that users see when selecting a skin to decorate their desktop. Summer loving is one of my favorite handwritten fonts as it has many alternative glyphs for most letters and its texture creates a summer vibe that really suits the skin\u2019s character. Google sans works as the main font. In comparison to summer loving it is rounder, creating a much needed contrast to its pointier edges. Google sans also offers great readability and it\u2019s both great for large text and small paragraphs, useful in the music player and the settings menu.",null,null,null,null,null,null,null,null)
B.a0b=new A.bO("favorites",null,null,null,null,null,null,null,null)
B.a0c=new A.bO("The logo",null,B.lS,null,null,null,null,null,null)
B.a0e=new A.bO("The goal of this feature for the future is to create fully automatic updates that happen automatically when users open their computer. This will make the use experience even more fluent removing the user\u2019s need to check for updates completely. Due to some limitations of rainmeter, progress is slow while I am doing a deeper research about multiple other ways to integrate this feature. Right now, all I can say is \u201ccoming soon\u201d!\n\nAnother possible idea is to create a skin distribution platform (like google play store) where developers can upload their skins and be eligible for OTA updates. There as been a test in the past creatin a platform like tis, but didn't go forward to due to its huge workload and platform limitations tat currently, I don't have the appropriate knowledge to work around.",null,null,null,null,null,null,null,null)
B.a0f=new A.bO('Influenced by many other successful motion graphic designs for TV channels, I took advantage of the characteristic shape inside "ERT"\'s "R" letter and used it as the primary form. Its appealing effect is caused by smooth opacity and position transitions which describe the overall character and design principles of the channel. The "Inside R" shape is playing a key part and is moving around with the basic information elements as a guide both for the eye and the ierarchy.',null,B.e9,null,null,null,null,null,null)
B.a0g=new A.bO("Ellinikon Vintage and Ellinikon Seaside typically operate independently but occasionally both are open simultaneously. The identity of Ellinikon Vintage is characterized by bold colors, strong typography, and vintage imagery. In contrast, Ellinikon Seaside emphasizes glamour and vibrant colors. Both entities share a common principle: events are communicated with a prominent, logo-like title, followed by additional information presented with lower hierarchy.",null,null,null,null,null,null,null,null)
B.a0i=new A.bO('Motions graphics presenting the channel\'s program for the "Old" movie in Alpha Greek channel.',null,B.e9,null,null,null,null,null,null)
