B.a0k=new A.bO("To create automatic updates, first it is needed to store the new files to an online database where they can be downloaded at any time GitHub is an excellent tool that not only stores the new files but also keeps track of version history and can offer the open source flag for any project. Then, after creating a GitHub repository, I made a script using basic PowerShell language which simply fetches (downloads) the repository as a .zip. After that, it unzips the file and replaces the old files with the new ones in the Rainmeter\u2019s skin folder.\n\nThis method is accompanied by an update checker in the settings which checks the current skin\u2019s version by reading a string in a local file and comparing it to another online file which contains the newest version as a string. If those versions match, the skin is up to date but if the local version is smaller than the online one, there is an update available. When pressing the \u201cCheck for updates\u201d button, the algorithm retrieves both strings, removes dots, coverts them to intEgers and makes the comparison with a simple substraction.\n\nThis simple approach was part of a detailed research on Rainmeter\u2019s capabilities and other languages, such as lua which is part of Rainmeter\u2019s development.",null,null,null,null,null,null,null,null)
